import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

export default function Events(){
    const eventName = ['abc', 'cba']
    const navigate = useNavigate();

    const handleLogout = () => {
        navigate('/')
    }

    return(
        <div style={{textAlign: 'center', display: 'flex', justifyContent: 'center', backgroundColor: '#CCCCFF', height: '100vh'}}>
            <h1>Events List</h1>
            <div>
                <label>All Events: </label>
                <ul>
                    {eventName.map((name, index) => (
                    <li key={index} onClick={e => navigate('/eventdetail', {state: {id: index}})}>{name}</li>
                    ))}
                </ul>
            </div>
            <div>
                <button onClick={handleLogout}>Logout</button>
            </div>
        </div>
    );
}
